@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("freemail.hu") {

/* minden altalÃ¡nos HTML elemre */
a,p,label,html,body,span,div,td,br,input,font,button,select,option {
font-family: Tahoma !important;
font-size: 8pt !important;
color: #666633 !important
}



/*-----reklamok eltuntetese-----*/

.szov-hird, #fototar-doboz, #nevjegy-doboz, #magnum, #jobb-banner, #jobb-banner-levelezes, #gh-doboz, #hrd, #jobb-banner-index, #hird-sav-index, #elso-index{
display: none !important
}



/*-----cseveges eltuntetese-----*/

#sendmsg_pane, span.balfej {
display: none !important;
}

.gyorshivo {
background-color: #EFF6FF !important;
}



/*--------belepes oldal---------*/

#bal-index {
float:none !important;
height:auto !important;
margin-top:8px !important;
padding:0 !important;
width:auto !important;
}

#masodik-index {
background-color: #EFF6FF !important;
float:none !important;
font-size:12px !important;
height:242px !important;
margin:auto !important;
padding:5px 10px 15px 10px !important;
width:205px !important;
}

#belepes-db-index {
background:#CCCCCC !important;
}

#logosor-index {
width: auto !important;
margin-right: 10px !important;
}



/* 1024px szeles kepernyore optimalizalt szelesseg */

#wrapper {
margin:20px auto 0px auto !important;
padding:0 !important;
width:1024px !important;
}

#lev-menu-mappak10 {
height: 350px !important;
}

#read_data, #readIFrame {
width: 880px !important;
}

#inner-body {
height: 300px !important;
width: 857px !important;
}

#level-test {
width: 840px !important;
}

#kozep {
width: 857px !important;
}

#inner-kozep {
width: 857px !important;
}

#levelek-lista {
width: 660px !important;
}

#levelek-lista ul li {
width: 650px !important;
}


/*--------eye candy :)---------*/


body {
background: none !important;
background-color: #e2f5e1 !important;
}

#wrapper {
background: none !important;
background-color: #e2f5e1 !important;
}

#bal {
border-top:6px solid #E2F5E1 !important;
margin:-10px 0 0 !important;
}

#fej {
background: none !important;
}

#koszonto {
border-bottom:none !important;
}

#levelezes-menu a, #leveleslada a { text-decoration: none !important;
}

#levelezes-menu a:hover, #leveleslada a:hover { text-decoration: underline !important;
}


/*------menu eltavolitasa------*/

#menu {
display:none !important;
}

#menu1 a, #menu2 a, #menu3 a, #menu4 a, #menu5 a, #menu6 a, #menu7 a, #levelezes #menu1 a, #uzenetkuldes #menu2 a, #telefonalas #menu3 a, #nevjegy #menu4 a, #cimtar #menu5 a, #fototar #menu6 a, #kepeslap #menu7 a {
background:none !important;
}

.myDropDownSelected, .myDropDownSelectedHover, div#fancyDropDown_A .myDropDownItem, div#fancyDropDown_A .myDropDownItemAct {
background-color: #EFF6FF !important;
}

#logosor {
width:1010px !important;
}

a.logo-index, .logo {
background: transparent url('data:image/jpeg;base64,') !important;
}

#felso-ikon, #also-ikon, #postafiok-index {
background-color:#cccccc !important;
}

#felso-ikon div.holder, #also-ikon div.holder {
display:block !important;
}

#felso-ikon div.balra, #also-ikon div.balra {
padding:5px 0 0 8px !important;
}

#levelezes-felso {
border: 1px solid #D6E3FA !important;
}

#levelezes-also {
border: 1px solid #D6E3FA !important;
}

#leveleim-rendezes th#rendezes-nev-holder, #leveleim-rendezes th#rendezes-ikonok-holder,#leveleim-rendezes th#rendezes-targy-holder,#leveleim-rendezes th#rendezes-datum-holder, #leveleim-rendezes th#rendezes-meret-holder{
background-color:#E2F5E1 !important;
border-right:1px solid #D6E3FA !important;
margin-right:10px !important;
padding-left:0 !important;
text-align:center !important;
}


}
